import axios from "axios";

export const instanse = axios.create({
    withCredentials:true,
    baseURL:"http://localhost:5000/api/",
    "Access-Control-Allow-Origin": "*",
    "Access-Control-Allow-Methods": "GET,PUT,POST,DELETE,PATCH,OPTIONS"
})
